import React, { Component } from 'react';
import { Link, Redirect} from 'react-router-dom';
import './AdminManager.css';
import logo from './logo.png';
class AdminManager extends Component {
    constructor(props){
        super(props);
        const token = localStorage.getItem("token");

        let loggedIn = true
        if(token == null){
            loggedIn = false
        }
        this.state = {
            loggedIn
        }
    }

    logout(e){
        e.preventDefault();
        localStorage.removeItem('token');
    }


    render() {
        if(this.state.loggedIn ===false){
            return <Redirect to="/"/>
        }

        return (
            <div>
                <div>
                    <form className="logout" onSubmit={this.logout}>
                        <Link to="/">Logout</Link>
                    </form>
                </div>
                <div>
                    <img src={logo} alt=""/>
                    <h1 style={{color:'blue'}}>ADMINISTRATOR</h1>
                </div>

                <div className="bt">
                    <div>
                        <Link to="/company-register">Company Register</Link>
                    </div>
                    <br/>
                    <Link to="/company-list">Company List</Link>
                </div>
            </div>    
        );
    }
}

export default AdminManager;
